window.bookSummaryJSON = "<p>Two years have passed since Jacen Solo, seduced by the dark side and re-anointed as the brutal Sith Lord Darth Cadeus, died at the hands of his twin sister, Jaina, Sword of the Jedi. For a grieving Han and Leia, the shadow of their son's tragic downfall still looms large.&nbsp;</p> <p>But Jacen's own bright and loving daughter, Allana, offers a ray of hope for the future as she thrives in her grandparents' care. And when the eager, inquisitive girl, in whom the Force grows ever stronger, makes a curious discovery aboard her grandfather's beloved spacecraft - the much overhauled but ever-dependable <i>Millennium Falcon</i> - the Solo family finds itself at a new turning point.&nbsp;</p> <p>Together they must set out on an odyssey into uncertain territory, untold adventure, and unexpected rewards.&nbsp;</p>"; 
